insert into ontology_definitions values (551, 1, "ZFA:0000578", "Endochondral bone that is bilaterally paired and articulates with the hypohyal cartilage or bone, dorsal and ventral hypohyals, and epihyal posteriorly. The ceratohyal bone begins as a ossification in the anterior portion of the ceratohyal cartilage (4.6 mm NL). The posterior end broadens and meets the epihyal in a pad of cartilage. The anterior end broadens and terminates in two heads (8.8 mm). The anterodorsal head forms a synchondrosis with the dorsal hypohyal and the anteroventral head forms a synchondrosis with the ventral hypohyal. All of the branchiostegal rays articulate with the ventral edge of the ceratohyal." , 1);
