insert into ontology_terms values (1300, 592, "quadrate", 0, 0, 0, 0);
insert into ontology_definitions values (592, 1, "ZFA:0000621", "The quadrate is the dorsal bone in the jaw joint with the anguloarticular of the lower jaw. Ossification of the quadrate, a cartilage bone, begins as a posteriorly projecting membranous spine between the symplectic cartilage and the preopercle (5.1 mm NL). The body of the quadrate ossifies first at the ball-and-socket articulation with the anguloarticular (6.5 mm). The adult quadrate is shaped roughly like an inverted triangle with a long, posteriorly projecting spine off its posteroventral edge. The presence of a posteroventral or posterior process of the quadrate is a synapomorphy of Teleostei." , 1);
insert into ontology_terms values (1301, 592, "quadrates", 1, 1, 0, 1);
