insert into ontology_definitions values (1207, 1, "ZFA:0001250", "Pharyngobranchial 2 (misidentified as pharyngobranchial 1 in Cubbage & Mabee, 1993 and Mayden 1989) is present and separate from pharyngobranchial 3.  It (8.0 mm) ossifies after pharyngobranchial 3. In the adult, the cartilaginous anterior end of the ossified pharyngobranchial 2 articulates with the cartilaginous medial tip of epibranchial 1. It articulates anterolaterally and posterolaterally with the anterior and posterior cartilaginous tips of epibranchial2.  In Cyprinidae pb3 overlaps pb2 (Siebert, 1987; Cavender & Coburn, 1992) but does not fuse to it." , 1);
