insert into ontology_definitions values (1419, 1, "ZFA:0001469", "The lateral line consists of small sensory patches (neuromasts) located superficially on the skin or just under the skin in fluid-filled canals on the head and body of all fishes and most amphibians. The lateral line develops from cranial ectodermal placodes situated behind the ear and between the eye and ear." , 1);
insert into ontology_terms values (2789, 1419, "lateral lines", 1, 1, 0, 1);
