insert into ontology_definitions values (1420, 1, "ZFA:0001470", "The anterior lateral line consists of small sensory patches (neuromasts) located superficially on the skin or just under the skin in fluid-filled canals on the head of all fishes and most amphibians. The anterior lateral line develops from cranial ectodermal placodes situated between the eye and ear." , 1);
