insert into ontology_terms values (3500, 1788, "middle lateral line system", 0, 0, 0, 0);
insert into ontology_definitions values (1788, 1, "ZFA:0005114", "The middle lateral line system develops from cranial ectodermal placodes, that give rise to both the neuromasts and the middle lateral line sensory nerves that innervate the neuromasts. The middle lateral line system consists of small sensory patches (neuromasts) located superficially on the skin or just under the skin in fluid-filled canals on the body  that are innervated by several lateral line nerves, which project to the hindbrain. The middle  lateral line system is stimulated by local water displacements and vibrations, and detects propulsion of the fish through the water, as well as facilitating shoaling, prey capture, and predator and obstacle avoidance." , 1);
