insert into ontology_terms values (3942, 2061, "gill opening", 0, 0, 0, 0);
insert into ontology_definitions values (2061, 1, "ZFA:0005389", "Anatomical space that is the external opening of a gill slit connecting the pharyngeal cavity to the exterior. Gill opening is usually paired and located on the lateral or ventral surfaces of the head." , 1);
