insert into ontology_terms values (3945, 2064, "infraorbital sensory canal", 0, 0, 0, 0);
insert into ontology_definitions values (2064, 1, "ZFA:0005392", "Sensory canal associated with the infraorbital bones. Located in close proximity to the otic and supraorbital sensory canals at their union. The infraorbital sensory canal is bilaterally paired.  The canal has 3 pores.  The first opens dorsally below the nasal sac, the second opens laterally posterior to the anterior maxilary barbel, the third pore is present where infraorbital 1 meets infraorbital 2." , 1);
insert into ontology_relationships values (2064, "xref", "TAO:0001811");
insert into ontology_relationships values (2064, "xref", "ZFIN:ZDB-ANAT-100614-46");
insert into ontology_relationships values (2064, "is_a", "ZFA:0005443");
insert into ontology_terms values (3946, 2065, "otic sensory canal", 0, 0, 0, 0);
insert into ontology_definitions values (2065, 1, "ZFA:0005393", "Sensory canal between and in close proximity posteriorly with the post-otic and preoperculo-mandibular sensory canals, and anteriorly with the supraorbital and infraorbital sensory canals. The otic sensory canal is bilaterally paired." , 1);
insert into ontology_relationships values (2065, "xref", "TAO:0001629");
insert into ontology_relationships values (2065, "xref", "ZFIN:ZDB-ANAT-100614-47");
insert into ontology_relationships values (2065, "is_a", "ZFA:0005443");
insert into ontology_terms values (3947, 2066, "post-otic sensory canal", 0, 0, 0, 0);
insert into ontology_definitions values (2066, 1, "ZFA:0005394", "Sensory canal  that forms dorsal to the horizontal semicircular canal of the ear. The anterior end of the canal may span or remain posterior to the pterotic-sphenotic junction. The posterior end of the postotic canal meets the temporal and supratemporal canals. The canal lies between and in close proximity to the trunk sensory canal and anteriorly with the otic and preoperculo-mandibular sensory canals. The post-otic sensory canal is bilaterally paired and when mature is fully enclosed in bone." , 1);
insert into ontology_terms values (3948, 2066, "postotic sensory canal", 1, 1, 0, 0);
insert into ontology_relationships values (2066, "xref", "TAO:0001619");
insert into ontology_relationships values (2066, "xref", "ZFIN:ZDB-ANAT-100614-48");
insert into ontology_relationships values (2066, "is_a", "ZFA:0005443");
insert into ontology_terms values (3949, 2067, "preoperculo-mandibular sensory canal", 0, 0, 0, 0);
insert into ontology_definitions values (2067, 1, "ZFA:0005395", "Sensory canal lateral or ventral to and in close proximity to the otic and post-otic sensory canals at their union. The preoperculo-mandibular sensory canal is bilaterally paired and associated with the preopercle, angular and dentary bones." , 1);
insert into ontology_relationships values (2067, "xref", "TAO:0001812");
insert into ontology_relationships values (2067, "xref", "ZFIN:ZDB-ANAT-100614-49");
insert into ontology_relationships values (2067, "is_a", "ZFA:0005443");
insert into ontology_terms values (3950, 2068, "supraorbital sensory canal", 0, 0, 0, 0);
insert into ontology_definitions values (2068, 1, "ZFA:0005396", "Sensory canal contained in the nasal and frontal bones.  It contains 4 or 5 neuromast. The first neuromast is positioned in the tubular nasal bone and the other neuromasts are located in the frontal bone.  The canal is anterior to and in close proximity to the otic and infraorbital sensory canals. The supraorbital sensory canal is bilaterally paired." , 1);
insert into ontology_relationships values (2068, "xref", "TAO:0001810");
insert into ontology_relationships values (2068, "xref", "ZFIN:ZDB-ANAT-100614-50");
