insert into ontology_definitions values (2442, 1, "ZFA:0005770", "Specialized olfactory support cell that surrounds crypt olfactory sensory neurons.   There are one or two support cells for each crypt neuron.  The cytoplasm of crypt neuron olfactory support cells is less electron dense then other support cells.  They also bear numerous microvilli at their apical rim. When two supporting cells are present, they interdigitate with each other  Mitochondria in crypt supporting cells are larger than those in the common supporting cells." , 1);
