insert into ontology_terms values (4526, 2451, "thymic epithelium", 0, 0, 0, 0);
insert into ontology_definitions values (2451, 1, "ZFA:0005779", "Epithelium within the thymus where lymphocytes mature.  Cells of the thymic epithelium have cytoplasm that appear devoid of most membrane bound organelles but contain bundles of cytoplasmic filaments, and frequent desmosomes occur between these epithelial cells. There are also secretory epithelial cells that contain a  heterogeneous population of electron-dense, cytoplasmic granules and a well developed Golgi complex.   Epithelial cysts are present after 3 weeks." , 1);
