insert into ontology_terms values (4527, 2452, "immature thymic epithelium", 0, 0, 0, 0);
insert into ontology_definitions values (2452, 1, "ZFA:0005780", "Epithelium of the thymus primordium composed of cells of immature morphology. The immature thymic epithelium is continuous with the pharyngeal epithelium.  The immature thymic epithelium is composed of electron-lucent epithelial cells of irregular or polygonal shape and contain numerous ribosomes, large electron-lucent mitochondria, and rough endoplasmic reticulum. Nascent desmosomes join these primitive epithelial cells together." , 1);
