insert into ontology_definitions values (2458, 1, "ZFA:0005786", "Wedge-shaped epidermal cell positioned along the apex of the developing fin fold. Each cleft cell retains a wedge-shaped form during fold formation and develops a basal cleft-shaped invagination. Invaginations are aligned in neighboring cleft cells so that these cells cap the distal boundary of the subepidermal space where collagenous extracellular fibres called actinotrichia run anteroposteriorly along the length of the fin fold." , 1);
