insert into ontology_terms values (4535, 2459, "hypophyseal artery", 0, 0, 0, 0);
insert into ontology_definitions values (2459, 1, "ZFA:0005787", "Artery that runs along the midline from anterior to posterior regions of the hypothalamus and splits into two capillary branches (hyc). The formation of the artery is initiated at the hypophysis itself and extends anteriorly until it connects with the palatocerebral arteries at day 2.5." , 1);
