insert into ontology_definitions values (2461, 1, "ZFA:0005789", "Axon tract originating  from the two hemispheres of the neurosecretory preoptic areas  converging into the midline and terminating at the ventral part of the hypothalamus at the presumed location of the pituitary. Analogous to the supraopticohypophyseal tract in mammals." , 1);
