insert into ontology_terms values (4552, 2473, "interrenal vessel", 0, 0, 0, 0);
insert into ontology_definitions values (2473, 1, "ZFA:0005801", "The interrenal vessel (IRV) is the blood vessels supplying the interrenal gland. It is formed by sprouting from the dorsal aorta.  The development of the IRV is temporally and spatially correlated with the initiation interrenal gland formation.  After traversing the interrenal tissue, the IRV connects  to the posterior end segment of the anterior mesenteric artery where two branches of swim bladder arteries branched out.  Angiogenic sprout is visible between 34 and 48 hpf with blood flow by 3dpf." , 1);
insert into ontology_terms values (4553, 2473, "IRV", 1, 1, 0, 0);
insert into ontology_relationships values (2473, "is_a", "ZFA:0005314");
insert into ontology_terms values (4554, 2474, "interrenal  angiogenic sprout", 0, 0, 0, 0);
insert into ontology_definitions values (2474, 1, "ZFA:0005802", "Sprout from the dorsal aorta that develops into the interrenal vessel." , 1);
insert into ontology_relationships values (2474, "is_a", "ZFA:0005604");
insert into ontology_terms values (4555, 2475, "cupula", 0, 0, 0, 0);
insert into ontology_definitions values (2475, 1, "ZFA:0005803", "Gelatinous substance surrounding the kinocila of the neuromast." , 1);
insert into ontology_relationships values (2475, "is_a", "ZFA:0001487");
insert into ontology_terms values (4556, 2476, "rhombencephalic efferent neurons to the lateral line", 0, 0, 0, 0);
insert into ontology_definitions values (2476, 1, "ZFA:0005804", "Efferent neuron where the cell body is located in the hindbrain reticular formation immediately adjacent to the medial longitudinal fascicle at the rostrocaudal level between the MiDl and the CaD and adjacent to the descending Mauthner axon.  RELL dendrites are large and extend bilaterally into the ventrolateral neuropil.  The ipsilateral dendrite reaches into a single area of the ventrolateral neuropil whereas the contralateral dendrite branches and extends into two different levels of the same rostrocaudal column of the ventrolateral neuropil. The axon emerges from the ventral part of the perikaryon courses a short distance rostrally to the level of the ROLE  cells and then turns laterally from the CNS accompanying the root of the posterior lateral line nerve." , 1);
insert into ontology_terms values (4557, 2476, "RELL neuron", 1, 1, 0, 0);
insert into ontology_relationships values (2476, "is_a", "ZFA:0009239");
insert into ontology_terms values (4558, 2477, "rhombencephalic octavola-teral efferent neuron", 0, 0, 0, 0);
insert into ontology_definitions values (2477, 1, "ZFA:0005805", "Efferent neuron located in the hindbrain.  The axon of ROLE cells travels rostrally near the ipsilateral medial longitudinal fascicle to the level of the Mauthner cell where it turns laterally to exit with the eighth nerve.  Outside the brain the  axon continues ventrally  to the base of the saccular macula in the ear then turns caudally to ender the ganglion of the posterior lateral line.   A branch of the axon  turns ventrally before the main axon enters the LLG.  The branch goes ventrally along the wall of the otic capsule." , 1);
insert into ontology_terms values (4559, 2477, "ROLE neuron", 1, 1, 0, 0);
insert into ontology_relationships values (2477, "is_a", "ZFA:0009239");
insert into ontology_terms values (4560, 2478, "diencephalic efferent neurons to the lateral line", 0, 0, 0, 0);
insert into ontology_definitions values (2478, 1, "ZFA:0005806", "Efferent neurons located ventrally in the diencephalon.  The dendrites extend into a large area of the diencephalic neuropil rostral, caudal, lateral and ventral to the cell body.  The axon courses dorsally and then caudally through the midbrain.   As the axon descends through the brain it gives off branches at several levels.   One branch usually exits the brain with the posterior lateral line nerve.  The axon can be traced into the cervical spinal cord." , 1);
insert into ontology_terms values (4561, 2478, "DELL neuron", 1, 1, 0, 0);
insert into ontology_relationships values (2478, "is_a", "ZFA:0009239");
insert into ontology_terms values (4562, 2479, "intestine lumen", 0, 0, 0, 0);
insert into ontology_definitions values (2479, 1, "ZFA:0005807", "Anatomical space within the intestine where digestion normally occurs.  The intestinal lumen begins as an interconnected web of small space at 43 hpf that over time remodels to form a single continuous tube at 68hpf.  Lumen maturation proceeds from anterior to posterior along the intestine." , 1);
insert into ontology_terms values (4563, 2479, "gut lumen", 1, 0, 1, 0);
insert into ontology_relationships values (2479, "is_a", "ZFA:0001643");
insert into ontology_terms values (4564, 2480, "proepicardial cluster", 0, 0, 0, 0);
insert into ontology_definitions values (2480, 1, "ZFA:0005808", "Transient cluster of cardiac progenitor cells that develops adjacent to the heart and migrates onto the heart to form the epicardium.  Proepicardial clusters in Zebrafish form on the pericardial wall, adjacent to the atrioventricular (AV) junction and near the venous pole." , 1);
