insert into ontology_definitions values (2799, 1, "ZFA:0009243", "A primary motor neuron part of the spinal cord. The CaP motoneuron is found within 1 soma diameter of the ventral root. The axon of the CaP motoneuron extends ventrally from the ventral root, within the space between the notochord and the medial surface of the axial muscles.  Below the notochord, the axon extends within the ventral median septum to the ventral edge of the axial muscles, where it turns dorsally and laterally to project over the lateral surface of the axial muscles." , 1);
