insert into ontology_definitions values (2803, 1, "ZFA:0009247", "Motor neurons that develop several hours later than primary motoneurons and sprout axons several hours after the primary motor growth cones have extended to the periphery.  They have smaller cell bodies and are located more ventrally and laterally in the spinal cord than primary motoneurons. Axons usually project directly out of the spinal cord with no apparent contact with the Mauthner axon and are positioned lateral to the Mauthner axon in their path to the ventral root.  Secondary motoneurons have smaller fields, which can overlap one another, and innervate many fewer muscle fibers than primary motoneurons." , 1);
